import './App.css';
import React from 'react'
import HeaderContainer from './components/header/HeaderContainer';
import Navbar from './components/navbar/Navbar';
import ProfileContainer from './components/profile/ProfileContainer';
import UsersContainer from './components/users/UsersContainer';
import DialogsContainer from './components/dialogs/DialogsContainer';
import Login from './components/login/Login';
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import {connect} from 'react-redux'
import {getData} from './redux/auth-reducer'
import {compose} from 'redux'
import {
  useLocation,
  useNavigate,
  useParams,
} from "react-router-dom";

function withRouter(Component) {
  function ComponentWithRouterProp(props) {
    let location = useLocation();
    let navigate = useNavigate();
    let params = useParams();
    return (
      <Component
        {...props}
        router={{ location, navigate, params }}
      />
    );
  }

  return ComponentWithRouterProp;
}


class App extends React.Component {

  componentDidMount() {
    this.props.getData()
  }

  render() {
    return (
      <BrowserRouter>
      <div >
        <header>
          <HeaderContainer />
        </header>
        <main>
          <Navbar /*sidebar={props.state.sidebarPage.sidebar}*//>
          <Router></Router>
          <Routes>
                <Route path='/profile/:userId?' element={<ProfileContainer h='Profile'/>}/>
                <Route path='/dialogs/*' element={<DialogsContainer h='Dialogs'/>}/>
                <Route path='/users' element={<UsersContainer h='Users'/>}/>
                <Route path='/login' element={<Login h='Login'/>}/>
          </Routes>
        </main>
      </div>
      </BrowserRouter>
    );
}
}
export default compose (
    withRouter,
    connect(null,{getData}))(App)
